import React from 'react'
import './index.css'



function ItemUser({name,email,address,}){






    return(
        <div id="user">
            <Item id="item1">Name: {name}</Item>
            <item id="item2">Email: {email}</item>
            <item id="item3">City: {address}</item>
        </div>
    )
}

export default ItemUser;
